n        // Exosome Treatment Details (English)\n        \"services.exosome.title.tagline\": \"Future of Hair Regeneration\",\n        \"services.exosome.title.fullDesc\": \"Exosome treatment is one of the newest and most effective methods of regenerative medicine. Exosomes are microscopic particles that provide intercellular communication. Exosomes applied to the scalp repair damaged follicles and trigger new hair growth.\",\n        \"services.exosome.title.results\": \"3-8 months\",\n        \"services.exosome.title.advantage1.title\": \"Latest Technology\",\n        \"services.exosome.title.advantage1.desc\": \"Latest discovery of regenerative medicine\",\n        \"services.exosome.title.advantage2.title\": \"Fast Results\",\n        \"services.exosome.title.advantage2.desc\": \"Visible results in 3-4 months\",\n        \"services.exosome.title.advantage3.title\": \"Minimally Invasive\",\n        \"services.exosome.title.advantage3.desc\": \"Application with injection only\",\n        \"services.exosome.title.advantage4.title\": \"Highly Effective\",\n        \"services.exosome.title.advantage4.desc\": \"Cellular level regeneration\",\n        \"services.exosome.title.process1.title\": \"Preparation\",\n        \"services.exosome.title.process1.desc\": \"Scalp cleaned and prepared\",\n        \"services.exosome.title.process2.title\": \"Exosome Application\",\n        \"services.exosome.title.process2.desc\": \"Special exosome serum injected into scalp\",\n        \"services.exosome.title.process3.title\": \"Follow-up\",\n        \"services.exosome.title.process3.desc\": \"Process monitored with regular check-ups\",\n        \"services.exosome.title.suitable1\": \"Those experiencing early-stage hair loss\",\n        \"services.exosome.title.suitable2\": \"Those wanting fast results\",\n        \"services.exosome.title.suitable3\": \"Individuals not wanting invasive procedures\",\n        \"services.exosome.title.suitable4\": \"Those wanting to improve hair qual